import { REGISTER, LOGIN, AUTHORIZATION, LOGOUT } from "../action-types"

export const register = (payload) => {
    return {
        type: REGISTER,
        payload,
    }
}

export const login = (payload) => {
    return {
        type: LOGIN,
        payload,
    }
}

export const authorization = (payload) => {
    return {
        type: AUTHORIZATION,
        payload,
    }
}

export const logout = (payload) => {
    return {
        type: LOGOUT,
    }
}
